VALUES ('3760159220052', 'Huile d\'olive vierge extra gourmet', 'LZQI Gourmet vous propose de retrouver les terres d\'Andalousie brulées par le soleil, au travers diun goût fruité de l\'olive mûre qui rappelera les fruits et arômes des bois, Elaborée et conditionnée sur son lieu de récolte cette huile d\'olive est obtenue de l\'assemblage des olives Lechin de Séville, Hojiblanca, Picual, Verdial, Manzanilla, issues d\'arbres centenaires situés à 5 km maximum du moulin. Huile d\'olive de catégorie supérieure obtenue directement des olives et uniquement par des procédés mécaniques. Pour une conservation optimale et le respect des qualités organoléptiques, cette huile doit être gardée à température constante, à l\'abri de l\'air et de la lumière. INFORMATIONS NUTRITIONNELLES Valeurs moyennes pour 100 g', 'https://static.openfoodfacts.org/images/products/376/015/922/0052/front_fr.4.400.jpg', '100', '13', '0', '0', '0', '0', '0', '0', '', '0');

